import React, { useState } from 'react';
import './TestSection.css';

const TestSection = () => {
  const [activeTab, setActiveTab] = useState('hd-voice');

  const tabs = [
    { id: 'hd-voice', label: 'HD Voice AI' },
    { id: 'text-to-speech', label: 'Text to Speech' },
    { id: 'speech-to-text', label: 'Speech to Text' }
  ];

  const renderContent = () => {
    switch (activeTab) {
      case 'hd-voice':
        return (
          <div className="test-content">
            <div className="test-header">
              <h3 className="test-title">HD VOICE AI</h3>
              <h4 className="test-subtitle">True HD voice, end-to-end</h4>
            </div>
            <p className="test-description">
              In-house NaturalHD voices and HD voice codecs are powered by our private global network to deliver more natural conversations with unmatched call clarity.
            </p>
            <p className="test-highlight">Experience the difference in voice quality</p>
            <div className="test-options">
              <button className="option-btn active">HD+ NaturalHD voices</button>
              <button className="option-btn">Standard codec</button>
            </div>
            <button className="btn btn-primary btn-large">
              <span className="btn-icon">📞</span>
              TALK TO OUR AGENT
            </button>
          </div>
        );
      
      case 'text-to-speech':
        return (
          <div className="test-content">
            <div className="test-header">
              <h3 className="test-title">TEXT TO SPEECH</h3>
              <h4 className="test-subtitle">Text to voice conversion</h4>
            </div>
            <p className="test-description">
              Enjoy clear and natural voices for a better calling experience with your customers.
            </p>
            <div className="test-input">
              <input 
                type="text" 
                placeholder="Type your message here..." 
                className="form-input"
              />
              <button className="btn btn-secondary">Convert to Speech</button>
            </div>
            <button className="btn btn-primary btn-large">
              <span className="btn-icon">🎤</span>
              TALK TO OUR AGENT
            </button>
          </div>
        );
      
      case 'speech-to-text':
        return (
          <div className="test-content">
            <div className="test-header">
              <h3 className="test-title">SPEECH TO TEXT</h3>
              <h4 className="test-subtitle">Real-time transcription</h4>
            </div>
            <p className="test-description">
              Transform audio into text with natural precision for content, communication and accessibility.
            </p>
            <div className="test-buttons">
              <button className="btn btn-secondary">
                <span className="btn-icon">🔴</span>
                RECORD AUDIO
              </button>
              <button className="btn btn-secondary">
                <span className="btn-icon">📁</span>
                UPLOAD FILE
              </button>
            </div>
            <button className="btn btn-primary btn-large">
              <span className="btn-icon">📞</span>
              TALK TO OUR AGENT
            </button>
          </div>
        );
      
      default:
        return null;
    }
  };

  return (
    <section className="test-section bg-white">
      <div className="container">
        <div className="test-container">
          <div className="test-tabs">
            {tabs.map((tab) => (
              <button
                key={tab.id}
                className={`test-tab ${activeTab === tab.id ? 'active' : ''}`}
                onClick={() => setActiveTab(tab.id)}
              >
                {tab.label}
              </button>
            ))}
          </div>
          
          <div className="test-card">
            {renderContent()}
          </div>
        </div>
      </div>
    </section>
  );
};

export default TestSection;
